"use strict";(self.webpackChunkjest_website=self.webpackChunkjest_website||[]).push([[2755],{1221:(e,s,t)=>{t.r(s),t.d(s,{assets:()=>u,contentTitle:()=>i,default:()=>l,frontMatter:()=>r,metadata:()=>a,toc:()=>A});var n=t(4246),o=t(1670);const r={title:"Performance des tests unitaires JavaScript",author:"Christoph Nakazawa",authorURL:"http://twitter.com/cpojer",authorFBID:0x5af311d9a1c8},i=void 0,a={permalink:"/fr/blog/2016/03/11/javascript-unit-testing-performance",editUrl:"https://github.com/jestjs/jest/tree/main/website/blog/2016-03-11-javascript-unit-testing-performance.md",source:"@site/i18n/fr/docusaurus-plugin-content-blog/2016-03-11-javascript-unit-testing-performance.md",title:"Performance des tests unitaires JavaScript",description:"Jest ex\xe9cute des milliers de tests sur Facebook \xe0 tout moment, soit par une int\xe9gration continue, soit par un appel manuel des ing\xe9nieurs pendant le d\xe9veloppement. Cela a bien fonctionn\xe9 pendant des ann\xe9es, m\xeame lorsque les personnes travaillant sur Jest ont \xe9t\xe9 transf\xe9r\xe9es vers d'autres projets au sein de Facebook.",date:"2016-03-11T00:00:00.000Z",formattedDate:"11 mars 2016",tags:[],readingTime:10.995,hasTruncateMarker:!0,authors:[{name:"Christoph Nakazawa",url:"http://twitter.com/cpojer"}],frontMatter:{title:"Performance des tests unitaires JavaScript",author:"Christoph Nakazawa",authorURL:"http://twitter.com/cpojer",authorFBID:0x5af311d9a1c8},unlisted:!1,prevItem:{title:"Jest 11.0",permalink:"/fr/blog/2016/04/12/jest-11"}},u={authorsImageUrls:[void 0]},A=[{value:"Planification optimale d&#39;une ex\xe9cution de test",id:"planification-optimale-dune-ex\xe9cution-de-test",level:2},{value:"Inline Requires and Lazy Mocking",id:"inline-requires-and-lazy-mocking",level:2},{value:"Repo-Sync et mise en cache",id:"repo-sync-et-mise-en-cache",level:2},{value:"Tout remettre en question",id:"tout-remettre-en-question",level:2},{value:"Tout additionner",id:"tout-additionner",level:2}];function c(e){const s=Object.assign({p:"p",ul:"ul",li:"li",strong:"strong",a:"a",code:"code",h2:"h2",em:"em",img:"img",pre:"pre"},(0,o.ah)(),e.components);return(0,n.jsxs)(n.Fragment,{children:[(0,n.jsx)(s.p,{children:"Jest ex\xe9cute des milliers de tests sur Facebook \xe0 tout moment, soit par une int\xe9gration continue, soit par un appel manuel des ing\xe9nieurs pendant le d\xe9veloppement. Cela a bien fonctionn\xe9 pendant des ann\xe9es, m\xeame lorsque les personnes travaillant sur Jest ont \xe9t\xe9 transf\xe9r\xe9es vers d'autres projets au sein de Facebook."}),"\n",(0,n.jsx)(s.p,{children:"Cependant, \xe0 mesure que les ing\xe9nieurs ajoutaient de plus en plus de tests, nous avons remarqu\xe9 que les performances de Jest n'allaient pas s'am\xe9liorer. En outre, au cours de l'ann\xe9e derni\xe8re, l'\xe9cosyst\xe8me JavaScript a radicalement chang\xe9 avec l'introduction de choses comme npm3 et Babel, ce que nous n'avions pas anticip\xe9. Nous avons form\xe9 une nouvelle \xe9quipe de Jest pour traiter tous ces probl\xe8mes et nous partagerons nos progr\xe8s et nos plans sur ce blog \xe0 partir de maintenant."}),"\n",(0,n.jsx)(s.p,{children:"Jest est un peu diff\xe9rent de la plupart des frameworks de test. Nous l'avons con\xe7u pour bien fonctionner dans le contexte de l'infrastructure de Facebook\xa0:"}),"\n",(0,n.jsxs)(s.ul,{children:["\n",(0,n.jsxs)(s.li,{children:[(0,n.jsx)(s.strong,{children:"Monorepo"})," Sur Facebook, nous avons un \xe9norme monorepo qui contient tout notre code JavaScript. Il y a de nombreuses raisons pour lesquelles cette approche est avantageuse pour nous et il y a un ",(0,n.jsx)(s.a,{href:"https://www.youtube.com/watch?v=W71BTkUbdqE",children:"discours g\xe9nial"})," d'un ing\xe9nieur Google qui met en \xe9vidence tous les avantages et inconv\xe9nients des monorepos."]}),"\n",(0,n.jsxs)(s.li,{children:[(0,n.jsx)(s.strong,{children:"La boxe \xe0 sable"})," Une autre fonctionnalit\xe9 de Jest qui est importante pour Facebook est la fa\xe7on dont elle virtualise l'environnement de test et enveloppe ",(0,n.jsx)(s.code,{children:"n\xe9cessite"})," pour ex\xe9cuter du code sandbox et isoler des tests individuels. Nous travaillons m\xeame \xe0 rendre Jest plus modulaire pour que nous puissions tirer parti de cette fonctionnalit\xe9 dans d'autres cas d'utilisation non li\xe9s aux tests."]}),"\n",(0,n.jsxs)(s.li,{children:[(0,n.jsx)(s.strong,{children:"providesModule"})," Si vous avez regard\xe9 l'un de nos projets JavaScript open source avant, vous avez peut-\xeatre remarqu\xe9 que nous utilisons un en-t\xeate ",(0,n.jsx)(s.code,{children:"@providesModule"})," pour assigner des identifiants globalement uniques aux modules. Cela n\xe9cessite des outils personnalis\xe9s, mais cela nous permet de r\xe9f\xe9rencer des modules sans chemins relatifs, ce qui nous a aid\xe9s \xe0 avancer incroyablement vite. a \xe9volu\xe9 ainsi que notre organisation d'ing\xe9nierie a grandi et a favoris\xe9 le partage de code dans toute l'entreprise. Consultez ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/relay/blob/4eae620d86ed7fce1ee463c2fca88eb690d9cbde/src/container/RelayContainer.js#L9",children:"RelayContainer"})," pour un exemple de comment cela fonctionne en pratique. Un inconv\xe9nient \xe0 cette approche, cependant, est que nous sommes forc\xe9s de lire et d'analyser toute notre base de code JavaScript afin de r\xe9soudre une seule requ\xeate requise. Cela serait \xe9videmment prohibitif sans mise en cache compl\xe8te, en particulier pour un processus de courte dur\xe9e comme Jest."]}),"\n"]}),"\n",(0,n.jsxs)(s.p,{children:["En raison de ces contraintes uniques, Jest ne pourra peut-\xeatre jamais \xeatre aussi rapide que les autres ex\xe9cuteurs de test lorsqu'il s'ex\xe9cute sur toute notre suite de tests. Cependant, les ing\xe9nieurs ont rarement besoin d'ex\xe9cuter Jest sur toute notre suite de tests. Propuls\xe9 par une analyse statique dans le projet ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/node-haste",children:"node-haste"})," \u2013 nous avons pu faire le mode par d\xe9faut pour ex\xe9cuter Jest sur Facebook ",(0,n.jsx)(s.code,{children:"jest --onlyChanged"}),", ou ",(0,n.jsx)(s.code,{children:"jest -o"}),". Dans ce mode, nous construisons un graphique de d\xe9pendance invers\xe9e pour ne trouver que les tests concern\xe9s qui doivent \xeatre ex\xe9cut\xe9s en fonction des modules qui ont \xe9t\xe9 modifi\xe9s."]}),"\n",(0,n.jsx)(s.h2,{id:"planification-optimale-dune-ex\xe9cution-de-test",children:"Planification optimale d'une ex\xe9cution de test"}),"\n",(0,n.jsx)(s.p,{children:"La plupart du temps, notre analyse statique d\xe9termine que plusieurs tests doivent \xeatre ex\xe9cut\xe9s. Le nombre de tests affect\xe9s peut aller de quelques tests \xe0 des milliers. Afin d'acc\xe9l\xe9rer ce processus, Jest effectue des parall\xe9lisations de tests entre les travailleurs. C'est g\xe9nial parce que la majeure partie du d\xe9veloppement de Facebook se produit sur des serveurs distants avec de nombreux c\u0153urs de processeur."}),"\n",(0,n.jsxs)(s.p,{children:["R\xe9cemment, nous avons remarqu\xe9 que Jest semblait souvent coinc\xe9 ",(0,n.jsx)(s.em,{children:"\xab En attente de 3 tests \xbb"})," jusqu'\xe0 une minute vers la fin d'une course. Il s'est av\xe9r\xe9 que nous avions quelques tests vraiment lents dans notre base de code qui dominaient l'ex\xe9cution. Bien que nous ayons pu acc\xe9l\xe9rer de mani\xe8re significative ces tests individuels, nous avons \xe9galement modifi\xe9 la fa\xe7on dont Jest planifie le fonctionnement des tests. Auparavant, nous avions l'habitude de planifier des ex\xe9cutions de tests bas\xe9es sur la travers\xe9e du syst\xe8me de fichiers, qui \xe9tait en fait assez al\xe9atoire. Voici un exemple de 11 tests en blocs gris sur deux travailleurs. La taille du bloc est le temps d'ex\xe9cution du test :"]}),"\n",(0,n.jsx)(s.p,{children:(0,n.jsx)(s.img,{alt:"perf-planification de base",src:t(5650).Z+"",width:"1274",height:"427"})}),"\n",(0,n.jsx)(s.p,{children:"Nous avons fait un m\xe9lange al\xe9atoire de tests rapides et lents, et l'un de nos tests les plus lents a fini par fonctionner comme presque tous les autres tests ont \xe9t\xe9 termin\xe9s, au cours desquels le second worker a \xe9t\xe9 inactif."}),"\n",(0,n.jsx)(s.p,{children:"Nous avons modifi\xe9 la planification des tests en fonction de leur taille de fichier, ce qui est g\xe9n\xe9ralement un bon proxy pour la dur\xe9e \xe0 laquelle un test va prendre. Un test avec quelques milliers de lignes de code prend probablement plus de temps qu'un test avec 15 lignes de code. Tandis que cette vitesse acc\xe9l\xe8re le test entier d'environ 10%, nous avons fini par trouver une meilleure heuristique : maintenant Jest stocke l'ex\xe9cution de chaque test dans une cache et lors des ex\xe9cutions suivantes, il planifie les tests les plus lents \xe0 ex\xe9cuter en premier. Dans l'ensemble, cela a contribu\xe9 \xe0 am\xe9liorer le temps d'ex\xe9cution de tous les tests d'environ 20%."}),"\n",(0,n.jsx)(s.p,{children:"Voici un exemple du m\xeame test avec une meilleure planification :"}),"\n",(0,n.jsx)(s.p,{children:(0,n.jsx)(s.img,{alt:"planifications am\xe9lior\xe9es par tranche",src:t(8992).Z+"",width:"1274",height:"427"})}),"\n",(0,n.jsx)(s.p,{children:"Parce que nous lan\xe7ons d'abord des tests lents, Jest peut parfois prendre beaucoup de temps pour d\xe9marrer \u2013 nous n\u2019imprimons les r\xe9sultats qu\u2019une fois le premier test termin\xe9. Pour l'avenir, nous pr\xe9voyons d'abord d'ex\xe9cuter les tests qui ont \xe9chou\xe9 pr\xe9c\xe9demment, parce que l'obtention de cette information aux d\xe9veloppeurs le plus rapidement possible importe le plus."}),"\n",(0,n.jsx)(s.h2,{id:"inline-requires-and-lazy-mocking",children:"Inline Requires and Lazy Mocking"}),"\n",(0,n.jsx)(s.p,{children:"Si vous avez d\xe9j\xe0 \xe9crit des tests avec Jasmine, ils ressemblent probablement \xe0 ceci :"}),"\n",(0,n.jsx)(s.pre,{children:(0,n.jsx)(s.code,{className:"language-js",children:"const sum = require('sum');\ndescribe('sum', () => {\n  it('works', () => {\n    expect(sum(5, 4)).toBe(9);\n  });\n});\n"})}),"\n",(0,n.jsxs)(s.p,{children:["Une chose sp\xe9ciale que nous faisons dans Jest est de r\xe9initialiser la totalit\xe9 du registre des modules apr\xe8s chaque test (appelez \xe0 ",(0,n.jsx)(s.code,{children:"il"}),") pour vous assurer que les tests ne d\xe9pendent pas les uns des autres. Avant Jest, les tests individuels d\xe9pendaient les uns des autres et l'\xe9tat interne des modules se divulguait souvent entre eux. Au fur et \xe0 mesure que les ing\xe9nieurs ont enlev\xe9, r\xe9ordonn\xe9 ou refa\xe7onn\xe9 les tests, certains ont commenc\xe9 \xe0 \xe9chouer, ce qui rend difficile pour les gens de comprendre ce qui se passait."]}),"\n",(0,n.jsxs)(s.p,{children:["Chaque test de Jest re\xe7oit une nouvelle copie de tous les modules, y compris les nouvelles versions de toutes les d\xe9pendances fictives qui prennent beaucoup de temps \xe0 g\xe9n\xe9rer pour chaque test. Un effet secondaire de ceci est que nous avons d\xfb appeler ",(0,n.jsx)(s.code,{children:"require"})," manuellement avant chaque test, comme ceci :"]}),"\n",(0,n.jsx)(s.pre,{children:(0,n.jsx)(s.code,{className:"language-js",children:"let sum;\ndescribe('sum', () => {\n  beforeEach(() => {\n    sum = require('sum');\n  });\n  it('works', () => {\n    expect(sum(5, 4)).toBe(9);\n  });\n  it('works too', () => {\n    // This copy of sum is not the same as in the previous call to `it`.\n    expect(sum(2, 3)).toBe(5);\n  });\n});\n"})}),"\n",(0,n.jsxs)(s.p,{children:["Nous avons construit une transformation babel appel\xe9e ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/fbjs/blob/main/packages/babel-preset-fbjs/plugins/inline-requires.js",children:"inline-requires"})," qui supprime les instructions de haut niveau et les ins\xe8re dans le code. Par exemple, la ligne ",(0,n.jsx)(s.code,{children:"const sum = require('sum');"})," sera retir\xe9 du code, mais chaque utilisation de la somme `` dans le fichier sera remplac\xe9e par ",(0,n.jsx)(s.code,{children:"require('sum')"}),". Avec cette transformation, nous pouvons \xe9crire des tests comme vous vous y attendiez dans Jasmine et le code se transforme en ceci :"]}),"\n",(0,n.jsx)(s.pre,{children:(0,n.jsx)(s.code,{className:"language-js",children:"describe('sum', () => {\n  it('works', () => {\n    expect(require('sum')(5, 4)).toBe(9);\n  });\n});\n"})}),"\n",(0,n.jsx)(s.p,{children:"Un grand effet secondaire de la ligne exige que nous n'ayons besoin que des modules que nous utilisons r\xe9ellement dans le test lui-m\xeame, au lieu de tous les modules que nous avons utilis\xe9s dans le fichier entier."}),"\n",(0,n.jsx)(s.p,{children:"Ce qui m\xe8ne \xe0 une autre optimisation : le bouchon paresseux. L'id\xe9e est de bouchonner uniquement les modules \xe0 la demande, qui est combin\xe9 avec inline nous sauve de bouchonner beaucoup de modules et toutes leurs d\xe9pendances r\xe9cursives."}),"\n",(0,n.jsxs)(s.p,{children:["Nous avons pu mettre \xe0 jour tous les tests en utilisant un ",(0,n.jsx)(s.a,{href:"https://github.com/cpojer/js-codemod/blob/master/transforms/outline-require.js",children:"codemod"})," en un rien de temps - c'\xe9tait un ",(0,n.jsx)(s.em,{children:"simple"})," 50, 00 changement de code de ligne. Inline n\xe9cessite et paresseux mocking a am\xe9lior\xe9 le temps de test de 50%."]}),"\n",(0,n.jsxs)(s.p,{children:["Le plugin babel inline-require est non seulement utile pour Jest mais aussi pour JavaScript normal. Il a \xe9t\xe9 exp\xe9di\xe9 par ",(0,n.jsx)(s.a,{href:"https://twitter.com/voideanvalue",children:"Bhuwan"})," \xe0 tous les utilisateurs de ",(0,n.jsx)(s.a,{href:"http://facebook.com/",children:"facebook.com"})," il y a juste une semaine et a consid\xe9rablement am\xe9lior\xe9 le temps de d\xe9marrage."]}),"\n",(0,n.jsx)(s.p,{children:"Pour l'instant, si vous souhaitez utiliser cette transformation dans Jest, vous devrez l'ajouter manuellement \xe0 votre configuration Babel. Nous travaillons sur des moyens de faciliter la mise en \u0153uvre de cette option."}),"\n",(0,n.jsx)(s.h2,{id:"repo-sync-et-mise-en-cache",children:"Repo-Sync et mise en cache"}),"\n",(0,n.jsx)(s.p,{children:"La version open source de Jest \xe9tait un fork de notre version interne, et nous synchroniserions Jest une fois tous les deux mois. Ce fut un processus manuel douloureux qui n\xe9cessitait de corriger de nombreux tests \xe0 chaque fois. Nous avons r\xe9cemment mis \xe0 jour Jest et apport\xe9 la parit\xe9 \xe0 toutes les plateformes (iOS, Android et web) et avons ensuite activ\xe9 notre processus de synchronisation. Maintenant, chaque changement de Jest en open source est ex\xe9cut\xe9 contre tous nos tests internes, et il n'y a qu'une seule version de Jest qui soit coh\xe9rente partout."}),"\n",(0,n.jsx)(s.p,{children:"La premi\xe8re fonctionnalit\xe9 dont nous avons pu profiter apr\xe8s le d\xe9blocage \xe9tait le cache du pr\xe9processeur. Si vous utilisez Babel avec Jest, Jest doit pr\xe9traiter chaque fichier JavaScript avant de pouvoir l'ex\xe9cuter. Nous avons construit un calque de mise en cache de sorte que chaque fichier, lorsqu'il n'est pas modifi\xe9, ne doit \xeatre transform\xe9 qu'une seule fois. Apr\xe8s avoir lib\xe9r\xe9 Jest, nous avons pu facilement r\xe9parer l'impl\xe9mentation de l'open source et l'exp\xe9dier sur Facebook. Cela a entra\xeen\xe9 une autre victoire de 50% sur la performance. Parce que la cache ne fonctionne que sur la seconde ex\xe9cution, l'heure de d\xe9but froide de Jest n'a pas \xe9t\xe9 affect\xe9e."}),"\n",(0,n.jsx)(s.p,{children:"Nous avons \xe9galement r\xe9alis\xe9 que nous faisions beaucoup d\u2019op\xe9rations de trajectoire lorsque nous r\xe9solvons des besoins relatifs. Parce que le registre des modules est r\xe9initialis\xe9 pour chaque test, il y a eu des milliers d'appels qui pourraient \xeatre m\xe9mois\xe9s. Une grande optimisation a \xe9t\xe9 d'ajouter beaucoup plus de mise en cache, pas seulement autour d'un seul test, mais aussi \xe0 travers les fichiers de test. Auparavant, nous g\xe9n\xe9rerions des m\xe9tadonn\xe9es de module pour la fonction d'automocking une fois pour chaque fichier de test. L'objet qu'un module exporte ne change jamais, donc nous partageons maintenant ce code entre les fichiers de test. Malheureusement, comme JavaScript et Node.js n'ont pas de m\xe9moire partag\xe9e, nous devons faire tout ce travail au moins une fois par processus de travail."}),"\n",(0,n.jsx)(s.h2,{id:"tout-remettre-en-question",children:"Tout remettre en question"}),"\n",(0,n.jsx)(s.p,{children:"Lorsque vous essayez d'am\xe9liorer les performances, il est important de plonger aussi dans les syst\xe8mes qui s'installent au-dessus et en dessous de votre syst\xe8me. Dans le cas de Jest, des choses comme Node.js et les fichiers de test eux-m\xeames, par exemple. L'une des premi\xe8res choses que nous avons faites \xe9tait de mettre \xe0 jour Node.js \xe0 Facebook \xe0 partir des ann\xe9es 0,10 \xe0 iojs et ensuite \xe0 Node 4. La nouvelle version de V8 a contribu\xe9 \xe0 am\xe9liorer les performances et a \xe9t\xe9 assez facile \xe0 mettre \xe0 jour."}),"\n",(0,n.jsxs)(s.p,{children:["Nous avons remarqu\xe9 que le module ",(0,n.jsx)(s.code,{children:"path"})," dans Node. s est lent lors de la cr\xe9ation de milliers d'op\xe9rations de chemin qui ont \xe9t\xe9 ",(0,n.jsx)(s.a,{href:"https://github.com/nodejs/node/pull/5123",children:"corrig\xe9es dans Node 5.7"}),". Jusqu'\xe0 ce que nous supprimions le support de Node 4 en interne sur Facebook, nous exp\xe9dierons notre propre version du module ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/node-haste/blob/master/src/fastpath.js",children:"fastpath"}),"."]}),"\n",(0,n.jsxs)(s.p,{children:["Nous avons ensuite commenc\xe9 \xe0 interroger le ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/node-haste",children:"node-haste"})," obsol\xe8te. Comme mentionn\xe9 pr\xe9c\xe9demment, le projet entier doit \xeatre analys\xe9 pour les en-t\xeates de ",(0,n.jsx)(s.code,{children:"@providesModule"})," pour construire un graphique de d\xe9pendances. Quand ce syst\xe8me a \xe9t\xe9 construit \xe0 l'origine, ",(0,n.jsx)(s.code,{children:"node_modules"})," n'existait pas et notre explorateur de syst\xe8me de fichiers ne les excluait pas correctement."]}),"\n",(0,n.jsxs)(s.p,{children:["Dans les versions pr\xe9c\xe9dentes, Jest lisait en fait tous les fichiers dans ",(0,n.jsx)(s.code,{children:"node_modules"})," \u2013 ce qui a contribu\xe9 au lente temps de d\xe9marrage de Jest. Lorsque nous avons repris Jest, nous avons remplac\xe9 l'ensemble du projet par une nouvelle impl\xe9mentation, bas\xe9e sur l'empaquetage de react-native. Le temps de d\xe9marrage de Jest est maintenant inf\xe9rieur \xe0 une seconde, m\xeame sur les grands projets. L'\xe9quipe react-native ",(0,n.jsx)(s.a,{href:"https://twitter.com/void_0",children:"David"}),", ",(0,n.jsx)(s.a,{href:"https://twitter.com/amasad",children:"Amjad"})," et ",(0,n.jsx)(s.a,{href:"https://twitter.com/martinbigio",children:"Martin"})," ont fait un travail remarquable sur ce projet."]}),"\n",(0,n.jsx)(s.h2,{id:"tout-additionner",children:"Tout additionner"}),"\n",(0,n.jsx)(s.p,{children:"Un grand nombre des changements ci-dessus ont am\xe9lior\xe9 le temps d'ex\xe9cution du test de 10% ou parfois m\xeame de 50%. Nous avons commenc\xe9 \xe0 une dur\xe9e d'ex\xe9cution d'environ 10 minutes pour tous les tests, et sans ces am\xe9liorations, nous serions probablement \xe0 environ 20 minutes. Apr\xe8s ces am\xe9liorations, cependant, il faut maintenant toujours environ 1 minute et 35 secondes pour ex\xe9cuter tous nos tests !"}),"\n",(0,n.jsx)(s.p,{children:"Plus important encore, l'ajout de nouveaux tests entra\xeene une croissance tr\xe8s lente du temps d'ex\xe9cution total. Les ing\xe9nieurs peuvent \xe9crire et ex\xe9cuter plus de tests sans en ressentir les co\xfbts."}),"\n",(0,n.jsxs)(s.p,{children:["With Jest's recent 0.9 release and performance improvements from the ",(0,n.jsx)(s.a,{href:"https://github.com/jestjs/jest/pull/599",children:"node-haste2 integration"}),", the runtime of the ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/relay",children:"Relay"})," framework's test suite went down from 60 seconds to about 25 and the ",(0,n.jsx)(s.a,{href:"https://github.com/facebook/react-native",children:"react-native"})," test suite now finishes in less than ten seconds on a 13\u201d MacBook Pro."]}),"\n",(0,n.jsxs)(s.p,{children:["Nous sommes tr\xe8s heureux des victoires que nous avons vues jusqu'\xe0 pr\xe9sent, et nous allons continuer \xe0 travailler sur Jest et \xe0 le rendre meilleur. Si vous \xeates curieux de contribuer \xe0 Jest, n'h\xe9sitez pas \xe0 nous contacter sur GitHub, ",(0,n.jsx)(s.a,{href:"https://discord.gg/j6FKKQQrW9",children:"Discord"})," ou Facebook :)"]})]})}const l=function(e={}){const{wrapper:s}=Object.assign({},(0,o.ah)(),e.components);return s?(0,n.jsx)(s,Object.assign({},e,{children:(0,n.jsx)(c,e)})):c(e)}},5650:(e,s,t)=>{t.d(s,{Z:()=>n});const n="data:image/png;base64,"},8992:(e,s,t)=>{t.d(s,{Z:()=>n});const n="data:image/png;base64,"},1670:(e,s,t)=>{t.d(s,{Zo:()=>a,ah:()=>r});var n=t(7378);const o=n.createContext({});function r(e){const s=n.useContext(o);return n.useMemo((()=>"function"==typeof e?e(s):{...s,...e}),[s,e])}const i={};function a({components:e,children:s,disableParentContext:t}){let a;return a=t?"function"==typeof e?e({}):e||i:r(e),n.createElement(o.Provider,{value:a},s)}}}]);